- input: "TEXT\x1CC00313510\x1CX0\x1C\x1CF3A\x1CAmended in response to FEC letter
    dated July 17, 2008.  In regards to noted discrepancy #1, when Pascrell for Congress
    examined its records it found no discrepancy.  Upon two separate conversations
    with analysts Vicky Hubbard on 8/7/2008 and analyst Leah Palmer on 8/12/2008,
    they too concluded that there was not a discrepancy that required remedial action.
    \ They noted on their computer system that there was not further action needed
    in regard to discrepancy number 1.  Discrepancy number 2 was a coding error made
    on the October 15th, 2007 report.  The coding has been rectified and that report
    along with all subsequent reports have been amended to reflect this change."
